webpackJsonp([0xc6ff90b96ccc],{597:function(a,e){a.exports={data:{markdownRemark:{html:'<h3>HackerOne Success Index</h3>\n<p>We introduce the HackerOne Success Index - a method to measure the effectiveness of HackerOne-powered vulnerability disclosure programs. The index calculates 6 dimensions by which programs can benchmark their success each month. Learn more <a href="https://hackerone.com/blog/success-in-vulnerability-disclosure">here</a>.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/nov_2015_success_index-e5cf3d248fbc7a28f63b685496c956a6-75f42.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 80.88888888888889%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="nov_2015_success_index"\n        title=""\n        src="/static/nov_2015_success_index-e5cf3d248fbc7a28f63b685496c956a6-e7ffa.png"\n        srcset="/static/nov_2015_success_index-e5cf3d248fbc7a28f63b685496c956a6-49813.png 125w,\n/static/nov_2015_success_index-e5cf3d248fbc7a28f63b685496c956a6-dc8a5.png 250w,\n/static/nov_2015_success_index-e5cf3d248fbc7a28f63b685496c956a6-e7ffa.png 500w,\n/static/nov_2015_success_index-e5cf3d248fbc7a28f63b685496c956a6-dda24.png 750w,\n/static/nov_2015_success_index-e5cf3d248fbc7a28f63b685496c956a6-75f42.png 900w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Disclosure Assistance</h3>\n<p>We provide hackers with the ability to request help in contacting an organization with a vulnerability through Disclosure Assistance. This enables HackerOne to take steps to identify the organization’s official vulnerability reporting process. Read more in our <a href="https://hackerone.com/blog/vulnerability-disclosure-assistance">blog</a>.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/nov_2015_disclosure_assistance-9a4fe128ac471b7686cf65bf4a2122c3-f3f75.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 47.5%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="nov_2015_disclosure_assistance"\n        title=""\n        src="/static/nov_2015_disclosure_assistance-9a4fe128ac471b7686cf65bf4a2122c3-19681.jpg"\n        srcset="/static/nov_2015_disclosure_assistance-9a4fe128ac471b7686cf65bf4a2122c3-ae0b5.jpg 125w,\n/static/nov_2015_disclosure_assistance-9a4fe128ac471b7686cf65bf4a2122c3-eba55.jpg 250w,\n/static/nov_2015_disclosure_assistance-9a4fe128ac471b7686cf65bf4a2122c3-19681.jpg 500w,\n/static/nov_2015_disclosure_assistance-9a4fe128ac471b7686cf65bf4a2122c3-17503.jpg 750w,\n/static/nov_2015_disclosure_assistance-9a4fe128ac471b7686cf65bf4a2122c3-1f344.jpg 1000w,\n/static/nov_2015_disclosure_assistance-9a4fe128ac471b7686cf65bf4a2122c3-f3f75.jpg 1280w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Trigger: Show Interstitial</h3>\n<p>We’ve updated our triggers functionality so that an interstitial shows prior to report submission. This helps hackers to avoid the submission of a number of out-of-scope or commonly reported false positives.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/nov_2015_Interstitial_trigger-9e62f1aaad23e4f2e1913d27d6a70850-247f6.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 494px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 50%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="nov_2015_interstitial_trigger"\n        title=""\n        src="/static/nov_2015_Interstitial_trigger-9e62f1aaad23e4f2e1913d27d6a70850-247f6.png"\n        srcset="/static/nov_2015_Interstitial_trigger-9e62f1aaad23e4f2e1913d27d6a70850-95bde.png 125w,\n/static/nov_2015_Interstitial_trigger-9e62f1aaad23e4f2e1913d27d6a70850-c1f7d.png 250w,\n/static/nov_2015_Interstitial_trigger-9e62f1aaad23e4f2e1913d27d6a70850-247f6.png 494w"\n        sizes="(max-width: 494px) 100vw, 494px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Automated Scanner Detection</h3>\n<p>We’ve updated our report classification engine to detect common outputs from automated vulnerability scanners that are frequently flagged as invalid. This enables the quality of report submissions to improve as hackers can check the report before submission.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/nov_2015_automated_scanner_detection-34831505bcb6ecb33d473e4093fc345d-370a2.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 16.187594553706504%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="nov_2015_automated_scanner"\n        title=""\n        src="/static/nov_2015_automated_scanner_detection-34831505bcb6ecb33d473e4093fc345d-e7ffa.png"\n        srcset="/static/nov_2015_automated_scanner_detection-34831505bcb6ecb33d473e4093fc345d-49813.png 125w,\n/static/nov_2015_automated_scanner_detection-34831505bcb6ecb33d473e4093fc345d-dc8a5.png 250w,\n/static/nov_2015_automated_scanner_detection-34831505bcb6ecb33d473e4093fc345d-e7ffa.png 500w,\n/static/nov_2015_automated_scanner_detection-34831505bcb6ecb33d473e4093fc345d-370a2.png 661w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Single Sign-On: SAML</h3>\n<p>We’ve improved our Single-Sign-On (SSO) options with support for SAML. Response teams using an SSO provider to authenticate can use those services for centralized authorization and identity management.</p>\n<h3>Suggest a Bounty</h3>\n<p>There’s now a reward suggestion functionality where program members can suggest bounty amounts. This enables programs to more easily arrive at a consensus regarding award amounts.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/nov_2015_suggest_bounty-1f34b7515060eec509a53cbd249eed74-f30de.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 57.12328767123288%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="nov_2015_suggest_bounty"\n        title=""\n        src="/static/nov_2015_suggest_bounty-1f34b7515060eec509a53cbd249eed74-e7ffa.png"\n        srcset="/static/nov_2015_suggest_bounty-1f34b7515060eec509a53cbd249eed74-49813.png 125w,\n/static/nov_2015_suggest_bounty-1f34b7515060eec509a53cbd249eed74-dc8a5.png 250w,\n/static/nov_2015_suggest_bounty-1f34b7515060eec509a53cbd249eed74-e7ffa.png 500w,\n/static/nov_2015_suggest_bounty-1f34b7515060eec509a53cbd249eed74-f30de.png 730w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Report Abuse</h3>\n<p>If any disagreements or discussions arise regarding a report, hackers and programs can now request mediation and our experts will provide guidance on the situation.</p>\n<h3>Group Assignments</h3>\n<p>The group assignments feature enables programs to assign reports to a team rather than just to an individual so that multiple people within a team have the ability to pick up the report.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/nov_2015_group_assignments-1585592bac4e235cc380f95d12dfb166-c7db2.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 471px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 30.957230142566196%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="nov_2015_group_assignments"\n        title=""\n        src="/static/nov_2015_group_assignments-1585592bac4e235cc380f95d12dfb166-50381.png"\n        srcset="/static/nov_2015_group_assignments-1585592bac4e235cc380f95d12dfb166-e588b.png 125w,\n/static/nov_2015_group_assignments-1585592bac4e235cc380f95d12dfb166-3d0a3.png 250w,\n/static/nov_2015_group_assignments-1585592bac4e235cc380f95d12dfb166-50381.png 500w,\n/static/nov_2015_group_assignments-1585592bac4e235cc380f95d12dfb166-23afa.png 750w,\n/static/nov_2015_group_assignments-1585592bac4e235cc380f95d12dfb166-c7db2.png 982w"\n        sizes="(max-width: 471px) 100vw, 471px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Improved Report Meta Data</h3>\n<p>We’ve updated the styling between the report meta data and the summary/timeline so that the report meta data is now collapsible.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/nov_2015_Report_Meta_Data-fb785f5074835017bd1ea6faa189b1a2-56522.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 478px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 52.00803212851406%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="nov_2015_report_meta_data"\n        title=""\n        src="/static/nov_2015_Report_Meta_Data-fb785f5074835017bd1ea6faa189b1a2-58039.png"\n        srcset="/static/nov_2015_Report_Meta_Data-fb785f5074835017bd1ea6faa189b1a2-29870.png 125w,\n/static/nov_2015_Report_Meta_Data-fb785f5074835017bd1ea6faa189b1a2-eb053.png 250w,\n/static/nov_2015_Report_Meta_Data-fb785f5074835017bd1ea6faa189b1a2-58039.png 500w,\n/static/nov_2015_Report_Meta_Data-fb785f5074835017bd1ea6faa189b1a2-4d25a.png 750w,\n/static/nov_2015_Report_Meta_Data-fb785f5074835017bd1ea6faa189b1a2-56522.png 996w"\n        sizes="(max-width: 478px) 100vw, 478px"\n      />\n    </span>\n  </span>\n  \n  </a>\n       </p>\n<h3>Integrations</h3>\n<p>We’ve added integrations with:</p>\n<ul>\n<li>Slack</li>\n<li>Redmine</li>\n<li>Freshdesk</li>\n</ul>\n<p>Read more about how these integrations work <a href="https://docs.hackerone.com/programs/supported-integrations.html">here</a>.</p>',frontmatter:{path:"/changelog/2015/november",title:"November 2015"}}},pathContext:{}}}});
